import{_ as t,c as o,o as a,a2 as r}from"./chunks/framework.DDIT__tB.js";const g=JSON.parse('{"title":"üìä Diagram: DocProc","description":"","frontmatter":{},"headers":[],"relativePath":"examples/models/dfd/doc-proc.md","filePath":"examples/models/dfd/doc-proc.md"}'),n={name:"examples/models/dfd/doc-proc.md"};function i(s,e,l,d,h,c){return a(),o("div",null,e[0]||(e[0]=[r('<h1 id="üìä-diagram-docproc" tabindex="-1">üìä Diagram: DocProc <a class="header-anchor" href="#üìä-diagram-docproc" aria-label="Permalink to &quot;üìä Diagram: DocProc&quot;">‚Äã</a></h1><h2 id="üîó-link-to-original-paper-article" tabindex="-1">üîó Link to Original Paper/Article <a class="header-anchor" href="#üîó-link-to-original-paper-article" aria-label="Permalink to &quot;üîó Link to Original Paper/Article&quot;">‚Äã</a></h2><p><a href="https://zenodo.org/records/15059455" target="_blank" rel="noreferrer">View Full Main Source</a></p><h2 id="üìù-short-description" tabindex="-1">üìù Short Description <a class="header-anchor" href="#üìù-short-description" aria-label="Permalink to &quot;üìù Short Description&quot;">‚Äã</a></h2><p>This diagram shows the flow of data from the DocProc system. As described in the main source this diagram consists of three main parts: (i) the customer facing part (left-hand side), which provides dashboards and self-service facilities to customer administrators for uploading templates, managing accounts, and uploading batches of raw data, (ii) the document generation facilities (depicted in the middle) that involve scheduling document generation jobs, and generating PDF documents, and (iii) the document delivery subsystem, which is responsible for orchestrating the delivery of documents (right-hand side)</p><h2 id="üî§-abbreviations" tabindex="-1">üî§ Abbreviations <a class="header-anchor" href="#üî§-abbreviations" aria-label="Permalink to &quot;üî§ Abbreviations&quot;">‚Äã</a></h2><p><strong>None</strong></p><h2 id="üìñ-extensive-description-if-possible" tabindex="-1">üìñ Extensive Description (if possible) <a class="header-anchor" href="#üìñ-extensive-description-if-possible" aria-label="Permalink to &quot;üìñ Extensive Description (if possible)&quot;">‚Äã</a></h2><p>For a more detailed description of the overall and inner workings of the system read the main source. Differences between this DFD and the one from the main source can be due to missing labels in the main source dfd, which we inferred as basic requests and confirmation data exchanges. In this section we explain the DFD of this application, which as mentioned earlier consists of three different parts.</p><p>In the first part, about the consumer facing part, the diagram starts with the <strong>Customer Admin</strong> node which sends the <em>document_templates</em>, <em>raw_data</em> and <em>admin_credentials</em> (needed to log into the system) to the <strong>Customer Organization Dashboard</strong>, which returns the <em>status</em> after receiving them. In the upper part of the diagram there is the <strong>DocProc Admin</strong> which sends the necessary infomation for the <em>organization_enrollment</em> (customer enrollment) to the <strong>Admin Dashboard</strong>, which receives this in addition to the DocProc <em>admin_credentials</em> from <strong>Admin Credentials</strong>. The <strong>Admin Dashboard</strong> also send certain <em>permissions</em> to the customer organization to the <strong>Customer organization Dashboard</strong>. This last node then stores the <em>document_templates</em> from the <strong>Template Storage</strong>.</p><p>Regarding the second part about the document generation, first the <strong>Customer Organization Dashboard</strong> sends the <em>raw_data</em> to the <strong>Input Verification</strong> node, which verifies the correctness of the raw data. This node then send the <em>raw_data</em> to the <strong>Raw Data Storage</strong> and a <em>batch_validation</em> (confirmation that the raw data batch received from the customer is valid) to the <strong>Generation Scheduler</strong>. This last node in turn sends a <em>validation_feedback</em> to te <strong>Input Verification</strong> node. The <strong>Generation Scheduler</strong> also receives the <em>next_generated_job</em> (raw data batch job) from the <strong>Document Generation</strong> node to schedule a generation of documents. The <strong>Document generation</strong> node also sends the <em>generated_pdf</em> to the <strong>Generated PDFs Archive Storage</strong>.</p><p>In this last part about the delivery of the documents first the <em>generated_pdfs</em> are retrieved from the <strong>Generated PDFs Archive Storage</strong> by the <strong>Delivery Scheduler</strong>. Here the <em>generated_pdfs</em> can follow 2 different paths. The first one is to the <strong>Personal Document Store</strong> where the <em>generated_pdfs</em> can then be retrieved by the <strong>Recipient</strong>. For retrieving these pdfs this node sends an <em>auth_request</em> and a <em>registe_request</em> in return. The second path is sending the <em>generated_pdfs</em> to the <strong>Delivery Manager</strong> which then forwards them to the <strong>Print Service</strong>, <strong>Email</strong> and <strong>Zoomit</strong> nodes. Thee last two nodes can then send a request for the <em>delivery_status</em> of the documents to the <strong>Delivery Manager</strong>.</p><h2 id="üè∑Ô∏è-label-description" tabindex="-1">üè∑Ô∏è Label description <a class="header-anchor" href="#üè∑Ô∏è-label-description" aria-label="Permalink to &quot;üè∑Ô∏è Label description&quot;">‚Äã</a></h2><ul><li><h3 id="üóÇÔ∏è-data-labels" tabindex="-1">üóÇÔ∏è Data Labels: <a class="header-anchor" href="#üóÇÔ∏è-data-labels" aria-label="Permalink to &quot;üóÇÔ∏è Data Labels:&quot;">‚Äã</a></h3><ul><li><h3 id="data" tabindex="-1">Data: <a class="header-anchor" href="#data" aria-label="Permalink to &quot;Data:&quot;">‚Äã</a></h3><ul><li><strong>OrganizationEnrollemnt</strong>: Information for enrolling an organization/customer</li><li><strong>AdminCredentials</strong>: Credentials needed for the administrator (docProc or customer) to use the system</li><li><strong>CustomerRawData</strong>: Raw data from the customer to be put into the documents</li><li><strong>DocumentTemplates</strong>: Templates where the raw data is going to be filled in by DocProc</li><li><strong>NextGenerationJob</strong>: Information to the Generation Scheduler for the next batch of documents that need to be generated</li><li><strong>GeneratedPDFs</strong>: Documents to be generated by DocProc</li><li><strong>ScheduleDelivery</strong>: Schedule for the delivery of documents to the customer</li><li><strong>Permissions</strong>: Permission given by the admin dashboard to the customer dashboard</li><li><strong>BatchValidation</strong>: Confirmation that the batch of raw data is valid</li><li><strong>ValidationFeedback</strong>: Feedback/confirmation from the validation of the batch</li></ul></li><li><h3 id="reports" tabindex="-1">Reports: <a class="header-anchor" href="#reports" aria-label="Permalink to &quot;Reports:&quot;">‚Äã</a></h3><ul><li><strong>Error</strong>: Error report from the Customer Organization Dashboard to the customer (e.g. failed raw data loading)</li><li><strong>Staus</strong>: Status from the uploading of the data by the customer to its dashboard</li></ul></li><li><h3 id="requests" tabindex="-1">Requests: <a class="header-anchor" href="#requests" aria-label="Permalink to &quot;Requests:&quot;">‚Äã</a></h3><ul><li><strong>Enrollment</strong>: Request for enrollment of an organization</li><li><strong>DeliveryStatus</strong>: Request for knowing the delivery status of the documents</li><li><strong>Register</strong>: Request for registering into the Personal Document Store</li><li><strong>Authenticate</strong>: Request for authentication into the Personal Document Store</li></ul></li></ul></li><li><h3 id="üè∑Ô∏è-node-labels" tabindex="-1">üè∑Ô∏è Node Labels: <a class="header-anchor" href="#üè∑Ô∏è-node-labels" aria-label="Permalink to &quot;üè∑Ô∏è Node Labels:&quot;">‚Äã</a></h3><ul><li><h3 id="module" tabindex="-1">Module: <a class="header-anchor" href="#module" aria-label="Permalink to &quot;Module:&quot;">‚Äã</a></h3><ul><li><strong>DeliveryManager</strong>: This node belongs to the Delivery Manager module/component</li></ul></li><li><h3 id="securitylevel" tabindex="-1">SecurityLevel: <a class="header-anchor" href="#securitylevel" aria-label="Permalink to &quot;SecurityLevel:&quot;">‚Äã</a></h3><ul><li><strong>Secure</strong>: This node is secure</li></ul></li></ul></li></ul><h2 id="‚ö†Ô∏è-constraints" tabindex="-1">‚ö†Ô∏è Constraints <a class="header-anchor" href="#‚ö†Ô∏è-constraints" aria-label="Permalink to &quot;‚ö†Ô∏è Constraints&quot;">‚Äã</a></h2><ul><li><p>The generated pdfs (possibly containing sensitive information) should never flow to a node which is not secure</p><ol><li><strong>secure</strong>: <code>data Data.GeneratedPDFs neverFlows vertex !SecurityLevel.Secure</code></li></ol></li></ul><h2 id="üö®-violations" tabindex="-1">üö® Violations <a class="header-anchor" href="#üö®-violations" aria-label="Permalink to &quot;üö® Violations&quot;">‚Äã</a></h2><ul><li><strong>None</strong></li></ul>',18)]))}const u=t(n,[["render",i]]);export{g as __pageData,u as default};
